export default {
  name: 'DetailsList', // 车船总览table列表
  props: {
    list: {
      type: Array,
      'default': null
    }
  },
  methods: {
    headerRowClass({ row, rowIndex }) {
      return 'detail-header'
    },
    rowClass({ row, rowIndex }) {
      return 'detail-header'
    },
    ifeesFormat(row, column) {
      return row.ifees === 0 ? '否' : '是'
    },
    lineFormat(row, column) {
      return '线路' + row.routeNo
    }
  }
}
